import React from 'react'
import { Container, Row, Wrapper } from './styles'

const Header = () => {
  return (
    <Wrapper>
        <Container>
            <Row>
                <img src='./logo.webp' alt="logo"/>
            </Row>
        </Container>
    </Wrapper>
  )
}

export {Header}
